class ListNode:

    def __init__(self, val=0, next=None):
        self.val = val
        self.next = next

def entance(head):
    if head is None and head.next is None:
        return False
    slow = head
    fast = head.next
    while slow != fast:
        if fast is None or fast.next is None:
            return False
        slow = slow.next
        fast = fast.next.next
    return True

